import {
  Grid,
  Paper,
  Typography,
  Button,
  TextField,
  makeStyles,
} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  body: {
    padding: '60px 60px',
    margin: '150px 400px',
  },
  inputBox: {
    width: '300px',
    margin: '-12px',
  },
  submitButton: {
    width: '300px',
    margin: '15px',
    backgroundColor: '#034f84',
  },
}));

const Login = (props) => {
  const classes = useStyles();

  return (
    <Paper elevation={3} className={classes.body}>
      <Grid container direction="column" spacing={4} alignItems="center">
        <Grid item>
          <Typography variant="h4" component="h2">
            Login
          </Typography>
        </Grid>
        <Grid item>
          <TextField type="email" label="Email" className={classes.inputBox} />
        </Grid>
        <Grid item>
          <TextField
            type="password"
            label="Password"
            className={classes.inputBox}
          />
        </Grid>
        <Grid item>
          <Button variant="contained" className={classes.submitButton}>
            Login
          </Button>
        </Grid>
      </Grid>
    </Paper>
  );
};

export default Login;
